import React from 'react';
import { Link } from 'react-router-dom';
import './style.css';

const Home = () => {
  return (
    <section className="home" id="home">
      <div className="home-text">
        <h1>Wisata <br /> Pulau Seribu</h1>
        <p>Explore thousands of islands in the land of Jakarta</p>
        <Link to="/destinations" className="home-btn">See More!</Link>
      </div>
      <div className="additional-text">
        Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sed fringilla ultricies semper. Sed tincidunt, nulla et laoreet bibendum, lorem dolor mattis nisl, nec rhoncus turpis ipsum at urna. Mauris sed metus vel erat condimentum posuere vitae et turpis. Nam tincidunt sapien in felis luctus rhoncus. In hac habitasse platea dictumst. Aenean ac ullamcorper nisi. Duis nec velit eget ex laoreet accumsan eu id dui. Vivamus a mauris eget tellus ultrices vestibulum vitae ut nisi. Ut vel velit et erat pharetra rutrum. Nullam ut placerat ligula, in bibendum metus. Sed vitae metus ut diam scelerisque semper et sed ex. In hac habitasse platea dictumst. Ut faucibus ante sem, at posuere justo dapibus ac.
      </div>
    </section>
  );
};

export default Home;
